description:
ศูนย์เรื่องราวร้องทุกข์ ได้รับการประสานผ่านระบบการจัดการเรื่องราวร้องทุกข์ สำนักงานปลัดสำนักนายกรัฐมนตรี ทำเนียบรัฐบาล รหัสเรื่อง นร02660020448
ขอให้ปรับปรุงการให้บริการของเจ้าหน้าที่ฝ่ายทะเบียน สำนักงานเขตหลักสี่ แขวงทุ่งสองห้อง เขตหลักสี่ กรุงเทพมหานคร
สืบเนื่องจากวันที่ 14 พ.ค 2566 (วันเลือกตั้ง) ได้รับทราบจากข่าวสารว่าทางเขต/อำเภอ เปิดให้บริการทำบัตรประชาชน ในวันนั้นข้าพเจ้าได้พาภรรยาไปใช้สิทธิ์เลือกตั้งในเขตพื้นที่หลักสี่ แล้วได้พาลูกสาวไปเข้ารับบริการทำบัตรประชาชน (เนื่องจากบัตรหมดอายุและสูญหาย) ในเวลาประมาณ 10.45 น.ข้าพเจ้าได้พาภรรยาและลูกสาวเข้าไปติดต่อที่สำนักงานเขตหลักสี่ ฝ่ายทะเบียนได้รับบัตรคิวหมายเลขA 012 ทางเจ้าหน้าที่ได้ให้ภรรยาข้าพเจ้ากรอกเอกสารและเรียกเข้ารับบริการตามคิวที่ช่องบริการช่องที่ 6 เจ้าหน้าที่ได้สอบถามข้อมูลเพิ่มเติมและ ได้มีเจ้าหน้าที่อีกท่านหนึ่งเข้ามาสอบถามเพิ่มเติมว่าลูกสาวอายุเท่าไหร่ ภรรยาของข้าพเจ้าได้ตอบเจ้าหน้าที่ท่านนั้นไปว่าลูกสาวอายุ 17 ปี เจ้าหน้าที่ท่านนั้นจึงแจ้งให้ภรรยาของข้าพเจ้าทราบว่าวันนี้เปิดให้บริการเฉพาะ”ผู้ที่ทำบัตรเพื่อไปใช้สิทธิ์เลือกตั้งเท่านั้น”  จึงไม่สามารถให้บริการได้ทั้งที่ผู้เข้ารับบริการขณะนั้นจำนวนไม่มากเท่าไหร่  ข้าพเจ้าจึงได้พาครอบครัวเดินทางกลับไปติดต่อ ณ ที่ว่าการอำเภอบางปะอิน จ.พระนครศรีอยุธยา (ในเขตพื้นที่ทำงานและที่อยู่ปัจจุบันของข้าพเจ้า) เพื่อขอรับบริการทำบัตรประชาชน  ภรรยาของข้าพเจ้าก็ได้รับความสะดวกในการให้บริการทำบัตรประชาชนได้เป็นอย่างดียิ่ง  ข้าพเจ้าจึงอยากทราบว่าการปฏิเสธการให้บริการของสำนักงานเขตหลักสี่ในวันนั้นเป็นไปตามนโยบาย หรือเป็นเพราะความละเลยของเจ้าหน้าที่ ที่ควรจะให้บริการแก่ประชาชนที่เดินทางไปเพื่อเข้ารับบริการในขณะนั้น ซึ่งเหตุที่ข้าพเจ้าได้พาลูกสาวและภรรยาไปใช้บริการในเขตหลักสี่เพราะลูกสาวของข้าพเจ้ามีทะเบียนบ้านอยู่ในเขตหลักสี่ ข้าพเจ้าเกิดความสงสัยว่าเพราะเหตุใดการให้บริการประชาชนในแต่ละเขต/อำเภอจึงมีความสามารถในการให้บริการประชาชนที่แตกต่างกันไม่เหมือนกัน
//หมายเหตุ ปักหมุดที่สำนักงานเขตเพราะไม่สามารถปักละติจูด ลองติจูดที่ชัดเจนได้ กรุณาอ่านรายละเอียดสถานที่จากรายละเอียดการแจ้งเป็นหลัก
//ศูนย์ฯ ประสานมาเพื่อตรวจสอบและดำเนินการและโปรดพิจารณาให้ความคุ้มครองผู้ร้องและผู้เกี่ยวข้องอย่าให้ต้องรับภัยหรือความไม่ชอบธรรมอันเนื่องมาจากการร้องเรียนการเป็นพยาน หรือการให้ข้อมูลนั้น #ศรท #ศรท1111
