ขอให้แก้ไขปัญหาการรวมกลุ่มสูบบุหรี่ ของพนักงานศูนย์การค้า บิ๊กซี สะพานควาย กรุงเทพมหานคร
พนักงานของบิ๊กซี สะพานควาย จับกลุ่มสูบบุหรี่ ทำให้ควันบุหรี่เข้ามาในบ้าน ได้แจ้งบิ๊กซีไปแล้ว ก็ไม่มีอะไรดีขึ้น เป็นมานานแล้ว ทนมานานแล้ว ขอต่อว่าพนักงานไป ก็มีท้าทาย ข่มขู่
//หมายเหตุ ปักหมุดที่สำนักงานเขตเพราะไม่สามารถปักละติจูด ลองติจูดที่ชัดเจนได้ กรุณาอ่านรายละเอียดสถานที่จากรายละเอียดการแจ้งเป็นหลัก
