ขอความช่วยเหลือเปลี่ยนหลอดไฟฟ้าส่องสว่างริมทางดับ จำนวน 2 ดวง บริเวณทางเดินภายในหมู่บ้านศิริสุข ซอยช่างอากาศอุทิศ 27 ถนนช่างอากาศอุทิศ แขวงดอนเมือง เขตดอนเมือง กรุงเทพมหานคร จุดสังเกต พอถึงสนามฟุตบอลภายในหมู่บ้านฯ ให้เลี้ยวไปด้านซ้าย แล้วให้ตรงเข้าไปประมาณ 300-500 เมตร จะพบไฟฟ้าส่องสว่างริมทางดับจำนวน 2 ดวง และถัดมาจากพื้นที่ดังกล่าว จะพบเห็นไฟฟ้าส่องสว่างริมทางอีกจำนวน  1 ดวง มีลักษณะไม่สว่างเท่าที่ควร ซึ่งอยู่ในพื้นที่สำนักงานเขตดอนเมือง (ไม่ทราบหน่วยงานที่รับผิดชอบแน่ชัด) เนื่องจากผู้ร้องแจ้งว่า ในบริเวณพื้นที่ดังกล่าว ประสบปัญหาไฟฟ้าส่องสว่างริมทางดับ จำนวน 2 ดวง และถัดมาจากพื้นที่ดังกล่าว จะพบเห็นไฟฟ้าส่องสว่างริมทางอีกจำนวน 1 ดวง มีลักษณะไม่สว่างเท่าที่ควร ทำให้ในช่วงตอนกลางคืนมืดมาก ส่งผลให้ผู้ร้องและประชาชนในพื้นที่ใช้เส้นทางสัญจรไม่สะดวก ประสบปัญหามาเป็นระยะเวลาประมาณ 2 วัน จึงประสงค์ให้หน่วยงานที่เกี่ยวข้องเร่งดำเนินการแก้ไขปัญหาดังกล่าว (ผู้ร้องประสงค์ให้ปกปิดชื่อ-นามสกุล และหมายเลขโทรศัพท์)
//หมายเหตุ ปักหมุดที่สำนักงานเขตเพราะไม่สามารถปักละติจูด ลองติจูดที่ชัดเจนได้ กรุณาอ่านรายละเอียดสถานที่จากรายละเอียดการแจ้งเป็นหลัก
//ศูนย์ฯ ประสานมาเพื่อตรวจสอบและดำเนินการและโปรดพิจารณาให้ความคุ้มครองผู้ร้องและผู้เกี่ยวข้องอย่าให้ต้องรับภัยหรือความไม่ชอบธรรมอันเนื่องมาจากการร้องเรียนการเป็นพยาน หรือการให้ข้อมูลนั้น #ศรท #ศรท1111
