ขอให้แก้ไขปัญหาการจำหน่ายสินค้าบนบาทวิถี บริเวณ ถนนจันทร์ ซอย 43 แยก 22 - 3  แขวงบางโคล่ เขตบางคอแหลม กรุงเทพมหานคร จุดสังเกตจะอยู่ด้านหน้าวัดไผ่เงินโชตนาราม เนื่องจากบริเวณดังกล่าวมีร้านจำหน่ายอาหารเป็นลักษณะร้านข้าวต้ม ชื่อว่าร้าน "ข้าวต้มมาเฟีย" เจ้าของร้านเป็นบุคคลเพศหญิง (ทราบชื่อเล่น) ซึ่งจะจำหน่ายเป็นประจำทุกวัน ตั้งแต่เวลา 18.00 น. ไปจนถึง 24.00 น.  ส่งผลให้ประสบปัญหากีดขวางการจราจร ต้องเดินแบบหลบหลีก หรือไม่สามารถที่จะเดินผ่านสัญจรได้ เนื่องจากมีลักษณะกีดขวางไปทั้งบาทวิถี  ก่อให้เกิดปัญหาการจราจรติดขัดตามมา จากการจำหน่ายสินค้า รวมถึงบดบังทัศนวิสัยในการรอรถโดยสารประจำทางอีกด้วย อีกทั้งทางเจ้าของร้านคนดังกล่าวมีลักษณะพฤติกรรมที่เป็นนักเลงมักจะพูดจาก คุกคาม ไม่เกรงกลัวใคร อาทิ "มึงเดินได้ก็เดิน" มักจะเจอปัญหามาโดยตลอด  พบเห็นมาเป็นระยะเวลาประมาณ 1-2 เดือน  จึงประสงค์ให้หน่วยงานที่เกี่ยวข้องเข้ามาแก้ไขปัญหา เพื่ออำนวยความสะดวกในการสัญจรของประชาชนในพื้นที่ (ผู้ร้องประสงค์ให้ปกปิด ชื่อ-นามสกุลและหมายเลขโทรศัพท์)
//หมายเหตุ ปักหมุดที่สำนักงานเขตเพราะไม่สามารถปักละติจูด ลองติจูดที่ชัดเจนได้ กรุณาอ่านรายละเอียดสถานที่จากรายละเอียดการแจ้งเป็นหลัก
//ศูนย์ฯ ประสานมาเพื่อตรวจสอบและดำเนินการและโปรดพิจารณาให้ความคุ้มครองผู้ร้องและผู้เกี่ยวข้องอย่าให้ต้องรับภัยหรือความไม่ชอบธรรมอันเนื่องมาจากการร้องเรียนการเป็นพยาน หรือการให้ข้อมูลนั้น #ศรท #ศรท1111
